import React from 'react';

const Projects = () => {
  return (
    <div className="container">
      <h1>Projects</h1>
      <ul>
        <li>
          <h2>Project One</h2>
          <p>Description of Project One.</p>
        </li>
        <li>
          <h2>Project Two</h2>
          <p>Description of Project Two.</p>
        </li>
      </ul>
    </div>
  );
}

export default Projects;
